//import { jsPDF } from "jspdf"
exports.add_font = function(jsPDF){
    var font = '';
    var callAddFont = function () {
        this.addFileToVFS('Sen-Regular-normal.ttf', font);
        this.addFont('Sen-Regular-normal.ttf', 'Sen-Regular', 'normal');
    };
    jsPDF.API.events.push(['addFonts', callAddFont])
}